import React, { useState, useEffect } from "react";
import HomeLayout from "../../layout/HomeLayout/HomeLayout";
import Splash from "../../components/splash/splash";
import Chat from "../../components/Chat/Chat";
import BACKILLU from "../../assets/icons/back-illustration.svg";
import PROFILECONSUL from "../../assets/images/profile-consul.jpg";
import CODEBOY from "../../assets/images/codeBoy.jpg";
const Index = ({ children }) => {
  const [loader, setLoader] = useState(true);

  useEffect(() => {
    const timeoutId = setTimeout(() => {
      setLoader(false);
    }, 4000);

    // Clean up the timeout when the component unmounts
    return () => clearTimeout(timeoutId);
  }, []); // Empty dependency array means this effect runs once on mount

  return (
    <HomeLayout>
      {loader ? (
        <Splash />
      ) : (
        <section
          style={{
            padding: "60px 24px 100px 24px",
            backgroundColor: "#f3f4f6",
            height: "auto",
            width: "100%",
          }}
        >
          <div
            style={{
              marginTop: "48px",
              backgroundColor: "#fff",
              borderRadius: "8px",
              backgroundImage: `url(${BACKILLU})`,
            }}
          >
            <p
              style={{
                fontFamily: "Bungee",
                fontSize: "24px",
                textAlign: "center",
                marginBottom: "0px",
                letterSpacing: "-0.01em",
                paddingTop: "30px",
              }}
            >
              Hii, ANKIT
            </p>
            <p
              style={{
                lineHeight: "18px",
                opacity: "0.3",
                letterSpacing: "-0.01em",
                fontWeight: "700",
                fontSize: "14px",
                textAlign: "center",
              }}
            >
              this is your current profile
            </p>
            <div
              style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                margin: "24px 66px 0 66px",
                padding: "10px 8px 10px 8px",
                borderRadius: "8px",
                flexDirection: "column",
                border: " 1px solid hsla(0,0%,9%,.13)",
              }}
            >
              <img
                style={{ height: "100px", borderRadius: "8px" }}
                src={PROFILECONSUL}
              />
              <p
                style={{
                  marginTop: "8px",
                  marginBottom: "0px",
                  fontWeight: "600",
                  fontSize: "14px",
                  textAlign: "center",
                }}
              >
                Ankit
              </p>
            </div>

            <p
              style={{
                marginTop: "12px",
                marginBottom: "0px",
                textAlign: "center",
                fontSize: "14px",
                fontWeight: "500",
                padding: "14px 0 14px 0",
                fontFamily: "Space Grotesk",
              }}
            >
              you are <span style={{ color: "#f76152" }}>0%</span> consistent
            </p>
            <img style={{ width: "100%" }} src={CODEBOY} />
          </div>

          <div
            style={{
              marginTop: "48px",
              backgroundColor: "rgb(23, 173, 125)",
              borderRadius: "8px",
            }}
          >
            <p
              style={{
                fontSize: "24px",
                textAlign: "center",
                marginBottom: "0px",
                color: "#fff",
                letterSpacing: "-0.01em",
                paddingTop: "30px",
                fontWeight: "600",
              }}
            >
              be consitent with <br /> your task <br />
              routine
            </p>
            <div style={{ display: "flex", justifyContent: "center" }}>
              <p
                style={{
                  marginTop: "12px",
                  marginBottom: "0px",
                  textAlign: "center",
                  fontSize: "18px",
                  fontWeight: "600",
                  width: "60%",
                  textAlign: "center",
                  background: "rgba(255, 255, 255, 0.6)",
                  boxShadow:
                    "rgba(96, 97, 112, 0.1) 0px 2px 4px 0px, rgba(40, 41, 61, 0.04) 0px 0px 1px 0px",
                  padding: "10px 24px",
                  borderRadius: "8px",
                  marginBlock: "18px",
                }}
              >
                explore task manager
              </p>
            </div>

            <img
              style={{ width: "100%", borderRadius: "47px 53px 79px 95px" }}
              src={CODEBOY}
            />
          </div>
          <div
            style={{
              marginTop: "48px",
              backgroundColor: "rgb(206, 194, 238)",
              borderRadius: "8px",
              backgroundImage: `url(${BACKILLU})`,
            }}
          >
            <p
              style={{
                fontFamily: "Bungee",
                fontSize: "24px",
                textAlign: "center",
                marginBottom: "0px",
                letterSpacing: "-0.01em",
                paddingTop: "30px",
              }}
            >
              Hii, ANKIT
            </p>
            <p
              style={{
                lineHeight: "18px",
                opacity: "0.3",
                letterSpacing: "-0.01em",
                fontWeight: "700",
                fontSize: "14px",
                textAlign: "center",
              }}
            >
              this is your current profile
            </p>
            <div
              style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                margin: "24px 66px 0 66px",
                padding: "10px 8px 10px 8px",
                borderRadius: "8px",
                flexDirection: "column",
                border: " 1px solid hsla(0,0%,9%,.13)",
              }}
            >
              <img
                style={{ height: "100px", borderRadius: "8px 0px" }}
                src={PROFILECONSUL}
              />
              <p
                style={{
                  marginTop: "8px",
                  marginBottom: "0px",
                  fontWeight: "600",
                  fontSize: "14px",
                  textAlign: "center",
                }}
              >
                Ankit
              </p>
            </div>

            <p
              style={{
                marginTop: "12px",
                marginBottom: "0px",
                textAlign: "center",
                fontSize: "14px",
                fontWeight: "500",
                padding: "14px 0 14px 0",
                fontFamily: "Space Grotesk",
              }}
            >
              you are <span style={{ color: "#f76152" }}>0%</span> consistent
            </p>
            <img style={{ width: "100%" }} src={CODEBOY} />
          </div>
          <div
            style={{
              marginTop: "48px",
              backgroundColor: "#fff",
              borderRadius: "8px",
              backgroundImage: `url(${BACKILLU})`,
            }}
          >
            <p
              style={{
                fontFamily: "Bungee",
                fontSize: "24px",
                textAlign: "center",
                marginBottom: "0px",
                letterSpacing: "-0.01em",
                paddingTop: "30px",
              }}
            >
              Hii, ANKIT
            </p>
            <p
              style={{
                lineHeight: "18px",
                opacity: "0.3",
                letterSpacing: "-0.01em",
                fontWeight: "700",
                fontSize: "14px",
                textAlign: "center",
              }}
